import Home from './Home';
import Navbar from './Navbar';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import Patinage from './Patinage';

function App() {
  return (
    <Router>
      <div className="App">
        <Navbar />
        <div className="content">
          <Switch>
            <Route path exact="/">
              <Home />
            </Route>
            <Route path exact="/patinage">
              <Patinage />
            </Route>
          </Switch>
        </div>
      </div>
    </Router>
  );
}

export default App;
